System packages are the only places where you can define functions that have side effects. Because they provide those system functions, applications can perform side effects, such as: I/O (console output, file system operations, etc.) Random number generation Concurrent/parallel computation Conventions System packages should never expose side effects directly through their functions ; all exported functions of their APIs must be pure. Instead, every system package should provide (usually) one context type on which those functions depend to make side effects. Then, actual context values of the type are injected into entry points of applications: the main functions. For example, a system package for command line applications should have the following types and functions: # Defines a foreign function to output a string on console.
import foreign "c" _pen_cli_put_string \(string) none type Context { putString: _pen_cli_put_string, ...
} Print = \(ctx Context, s string) none { ctx.putString(s)
} rather than: import foreign "c" _pen_cli_put_string \(string) none Print = \(s string) none { _pen_cli_put_string(s)
}

